function FilterContainer() {
    const srcList =[
    "/images/전체.svg",
    "/images/브랜드.svg"
  ];

  return (
    <div>
    <ul className="Filter_container">
    <div>
      {FilterButton(srcList[0])}
      <p className="Title_Text"> 전체 </p>
    </div>
    <div>
      {FilterButton(srcList[1])}
      <p> 상품 </p>
    </div>

      <FilterButton/>
      <FilterButton/>
      <FilterButton/>
    </ul>
  </div>
);
}

export default FilterContainer;



